import React from "react";
import Logo from "../img/bluefairy.png";

const Footer = () => {
  return (
    <footer>
      <img src={Logo} alt="" />
      <span>
      Let's have fun<b>@ FINDING NEVERLAND</b>
      </span>
    </footer>
  );
};

export default Footer;
